import configConstants from '@config/constants'

const {
  API: { baseURL, timeout }
} = configConstants

const fff = { name: 'Divine', age: '29' }
const vvv = Object.entries(fff).flat(1)

const buuks = 'hello'

console.log('buukssssss', vvv)

export default buuks
